INSERT INTO `lettre` (`LET_ID`, `LET_TYPE_ID`, `LET_NAME`, `LET_CONTENT`) VALUES
(3, 6, 'lettre1', '<p  center;"><span  underline; font-size: large;">testssssssssss</span></p>'),
(23, 6, 'lettreT', '<p style="text-align: center;"><span style="text-decoration: underline; font-family: arial,helvetica,sans-serif; font-size: large;"><strong>dsfsefg&eacute;&agrave;&agrave;AAA</strong></span></p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: left;"><span style="text-decoration: underline; font-family: arial,helvetica,sans-serif; font-size: large;"><strong>prout !!!!!!!!!!! :)<span style="font-family: andale mono,times;">sfdvsfvfdsv</span></strong></span></p>\r\n<p style="text-align: left;">&nbsp;</p>\r\n<p style="text-align: left;">&nbsp;</p>\r\n<p style="text-align: left;"><span style="text-decoration: underline; font-family: arial,helvetica,sans-serif; font-size: large;"><strong><span style="font-family: andale mono,times;">$civilite_contact$ $nom_contact$ put de la fesse.</span></strong></span></p>\r\n<p style="text-align: left;">&nbsp;</p>\r\n<p style="text-align: left;"><em><span style="font-family: arial,helvetica,sans-serif; font-size: large;"><span style="font-family: andale mono,times; color: #48d52a;">$prenom_contact$</span></span></em></p>\r\n<p style="text-align: left;">&nbsp;</p>\r\n<p style="text-align: center;"><span style="font-family: arial,helvetica,sans-serif; font-size: large;"><span style="font-family: andale mono,times; color: #48d52a;">$adresse_contact$</span></span></p>'),
(26, 6, 'lettre2', '<p style="text-align: center;"><strong style="color: #46bd41;">zqdgqg</strong></p>'),
(27, 7, 'Anti_carie', '<address><span style="font-size: small;">Association La mie de pain</span></address><address><span style="font-size: small;">64 avenue de l&rsquo;Amiti&eacute;</span></address><address><span style="font-size: small;">98765 Solidaire </span></address>\r\n<p style="text-align: right;"><span style="font-size: small;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <em>$adresse_contact$</em></span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p style="color: #5049b5;" align="center"><span style="text-decoration: underline; font-size: large; font-family: book antiqua,palatino;">Nouvelle campagne 2013</span></p>\r\n<p style="color: #5049b5;"><span style="font-size: large;">&nbsp;</span></p>\r\n<p><span style="font-size: small;"><strong>$civilite_contact$ $nom_contact$,</strong></span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p><span style="font-size: small;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Nous vous informons que la campagne de pr&eacute;vention dentaire 2013 a commenc&eacute;.</span></p>\r\n<p><span style="font-size: small;">Nous vous invitons d&egrave;s &agrave; pr&eacute;sent &agrave; nous envoyer vos dons, qui seront, nous vous le rappelons, d&eacute;fiscalis&eacute;s &agrave; hauteur de 66% du montant sur vos imp&ocirc;ts.</span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p><span style="font-size: small;">Nous vous remercions par avance de votre solidarit&eacute;.</span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p><span style="font-size: small;">Nos amiti&eacute;s les plus sinc&egrave;res,</span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p><span style="font-size: small;">Solidairement,</span></p>\r\n<p align="right"><span style="font-size: small;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></p>\r\n<p align="right"><span style="font-size: small;">Herv&eacute; Henri,</span></p>\r\n<p align="right"><span style="font-size: small;"><em>Pr&eacute;sident de La mie de pain</em></span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p style="text-align: right;"><span style="font-size: small;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Signature</span></p>'),
(32, 8, 'New_contact', '<address><span style="font-size: small;">Association La mie de pain</span></address><address><span style="font-size: small;">64 avenue de l&rsquo;Amiti&eacute;</span></address><address><span style="font-size: small;">98765 Solidaire </span></address>\r\n<p style="text-align: right;"><span style="font-size: small;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <em>$adresse_contact$</em></span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p style="color: #5049b5;" align="center"><span style="text-decoration: underline; font-size: large; font-family: book antiqua,palatino;">La mie de pain vous remercie<br /></span></p>\r\n<p style="color: #5049b5;"><span style="font-size: large;">&nbsp;</span></p>\r\n<p><span style="font-size: small;"><strong>$civilite_contact$ $nom_contact$,</strong></span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p><span style="font-size: small;">Nous avons bien re&ccedil;u votre don et vous nous en remercions. </span></p>\r\n<p><span style="font-size: small;">Vous ne tarderez pas recevoir un re&ccedil;u fiscal &agrave; l''adresse que vous nous avez indiqu&eacute;e.<br /></span></p>\r\n<p><span style="font-size: small;">Merci de nous avoir rejoint dans ce combat de tous les jours. N''h&eacute;sitez pas &agrave; nous contacter pour compl&eacute;ter vos informations personnels.</span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p><span style="font-size: small;">Nos amiti&eacute;s les plus sinc&egrave;res,</span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p><span style="font-size: small;">Solidairement,</span></p>\r\n<p align="right"><span style="font-size: small;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></p>\r\n<p align="right"><span style="font-size: small;">Herv&eacute; Henri,</span></p>\r\n<p align="right"><span style="font-size: small;"><em>Pr&eacute;sident de La mie de pain</em></span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p style="text-align: right;"><span style="font-size: small;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Signature</span></p>'),
(33, 7, 'Sidaction', '<p>Bonjour,</p>\n<p>&nbsp;</p>\n<p>Vous avez particip&eacute; au Sidaction, c''est gentil.</p>\n<p>Merci, $$nom$$</p>');
